                                   `last_hangup_time` bigint NOT NULL,
                                   `login_time` bigint NOT NULL,
                                   `client_ip` varchar(50) NOT NULL,
                                   `busy_lock_time` bigint NOT NULL,
                                   `skill_level` int NOT NULL,
                                   PRIMARY KEY (`id`) USING BTREE
