                                `biz_group_name` varchar(50) NOT NULL COMMENT '业务组名称',
                                `sort_no` int DEFAULT NULL COMMENT '排序',
                                `notes` varchar(255) DEFAULT NULL COMMENT '备注',
                                `create_time` datetime DEFAULT NULL COMMENT '创建时间',
